var $bm_rt;
var percent, t1, t2, t3, t4;
percent = thisComp.layer('percentageOne .percentageOne #percentageOne').text.sourceText.split('%')[0];
t1 = key(1).time;
t2 = key(2).time;
t3 = key(3).time;
t4 = key(4).time;
$bm_rt = value = $bm_mul($bm_mul(content('Rectangle 1').content('Rectangle Path 1').size[0], 0.01), percent);
if (time < t2) {
    $bm_rt = ease(time, t1, t2, [
        0,
        0
    ], [
        value,
        0
    ]);
} else {
    $bm_rt = ease(time, t3, t4, [
        value,
        0
    ], [
        0,
        0
    ]);
}

